webpackJsonp([0x86144f79aebf],{5209:function(t,e){t.exports={data:{post:{html:'<p>Astute readers will have noticed by now that I often give titles to my pages that have nothing to do with the content. <a href="http://www.vfth.com">Al</a> names his pages after song titles, but he at least gives the lyrics. I don\'t even bother to do that. My title yesterday was a current German pop song sung by TV actresses. Noone outside of Germany would recognize it, and since German webloggers don\'t watch TV and only listen to <a href="http://www.sexyjazz.de">sexyjazz</a>, no German reader would have recognized it either.</p>',fields:{title:"Straight Up, Now Tell Me",date:"19 Feb 2001",url:"https://papascott.de/2001-02-19-straight-up-now-tell-me/"}}},pathContext:{slug:"/2001-02-19-straight-up-now-tell-me/",prev:{fields:{title:"Daylight In Your Eyes",date:"18 Feb 2001",slug:"/2001-02-18-daylight-in-your-eyes/"}},next:{fields:{title:"With or Without You",date:"20 Feb 2001",slug:"/2001-02-20-with-or-without-you/"}}}}}});
